CREATE TABLE "Definition".ActiveItem (
	ActiveItemUuid UUID NOT NULL,
	OrganisationUuid UUID NOT NULL,
	ItemUuid UUID NOT NULL,
	AuditUuid UUID NOT NULL,
	ItemTypeId smallint NOT NULL,
	IsDeleted boolean NOT NULL,
	PRIMARY KEY (ActiveItemUuid)
);
CREATE TABLE "Definition".Audit (
	AuditUuid UUID NOT NULL,
	EndUserUuid UUID NOT NULL,
	TimeStamp timestamp NOT NULL,
	AuditVersion SERIAL NOT NULL,
	OrganisationUuid UUID NOT NULL,
	PRIMARY KEY (AuditUuid)
);
CREATE TABLE "Definition".DependencyType (
	DependencyTypeId smallint NOT NULL,
	Description varchar(100) NOT NULL,
	PRIMARY KEY (DependencyTypeId)
);
CREATE TABLE "Definition".Item (
	ItemUuid UUID NOT NULL,
	AuditUuid UUID NOT NULL,
	XmlContent text NOT NULL,
	Title varchar(255) NOT NULL,
	Description text NOT NULL,
	IsDeleted boolean NOT NULL,
	PRIMARY KEY (AuditUuid,ItemUuid)
);
CREATE TABLE "Definition".ItemDependency (
	ItemUuid UUID NOT NULL,
	AuditUuid UUID NOT NULL,
	DependentItemUuid UUID NOT NULL,
	DependencyTypeId smallint NOT NULL,
	PRIMARY KEY (AuditUuid,DependentItemUuid,ItemUuid)
);
CREATE TABLE "Definition".ItemType (
	ItemTypeId smallint NOT NULL,
	Description varchar(100) NOT NULL,
	PRIMARY KEY (ItemTypeId)
);
