    <uuid>5b94bfc6-31dd-4a34-989c-a25d6aa7d0a0</uuid>
    <name>Asthma patients over 65</name>
    <description>Asthma patients over 65</description>
    <folderUuid>e39e0358-5bd0-409a-9cb4-a8d352f76943</folderUuid>
    <query>
        <startingRules>
            <ruleId>1</ruleId>
        </startingRules>
        <rule>
            <description>Patients over 65</description>
            <id>1</id>
            <test>
                <dataSource>
                    <entity>PATIENT</entity>
                    <filter>
                        <field>AGE</field>
                        <valueFrom>
                            <constant>65</constant>
                            <absoluteUnit>numeric</absoluteUnit>
                            <operator>greaterThanOrEqualTo</operator>
                        </valueFrom>
                        <negate>false</negate>
                    </filter>
                </dataSource>
                <isAny/>
            </test>
            <onPass>
                <action>gotoRules</action>
                <ruleId>2</ruleId>
            </onPass>
            <onFail>
                <action>exclude</action>
            </onFail>
            <layout>
                <x>194</x>
                <y>5</y>
            </layout>
        </rule>
        <rule>
            <description>Patients with Asthma</description>
            <id>2</id>
            <test>
                <dataSource>
                    <entity>OBSERVATION</entity>
                    <filter>
                        <field>CODE</field>
                        <codeSet>
                            <codingSystem>SnomedCt</codingSystem>
                            <codeSetValue>
                                <code>195967001</code>
                                <includeChildren>true</includeChildren>
                            </codeSetValue>
                        </codeSet>
                        <negate>false</negate>
                    </filter>
                </dataSource>
                <isAny/>
            </test>
            <onPass>
                <action>include</action>
            </onPass>
            <onFail>
                <action>exclude</action>
            </onFail>
            <layout>
                <x>218</x>
