INSERT INTO "Definition".Item(ItemUuid, AuditUuid, XmlContent, Title, Description, IsDeleted) VALUES ('71EEC4BE-C215-43AC-94B5-BB198E1FD268', '640573BD-48D8-46E4-9B45-41805F51AC4A', '<?xml version="1.0" encoding="UTF-8" standalone="yes"?>
<libraryItem>
    <uuid>71eec4be-c215-43ac-94b5-bb198e1fd268</uuid>
    <name>Patients 30-75 registered last months</name>
    <description>Patients 30-75 registered last months</description>
    <folderUuid>e39e0358-5bd0-409a-9cb4-a8d352f76943</folderUuid>
    <query>
        <startingRules>
            <ruleId>1</ruleId>
        </startingRules>
        <rule>
            <description>Patients 30-75 registered last months</description>
            <id>1</id>
            <test>
                <dataSource>
                    <entity>PATIENT</entity>
                    <filter>
                        <field>REGISTRATION_DATE</field>
                        <valueFrom>
                            <constant>-12</constant>
                            <relativeUnit>month</relativeUnit>
                            <operator>greaterThanOrEqualTo</operator>
                        </valueFrom>
                        <negate>false</negate>
                    </filter>
                    <filter>
                        <field>AGE</field>
                        <valueFrom>
                            <constant>30</constant>
                            <absoluteUnit>numeric</absoluteUnit>
                            <operator>greaterThanOrEqualTo</operator>
                        </valueFrom>
                        <negate>false</negate>
                    </filter>
                    <filter>
                        <field>AGE</field>
                        <valueTo>
                            <constant>75</constant>
                            <absoluteUnit>numeric</absoluteUnit>
                            <operator>lessThanOrEqualTo</operator>
                        </valueTo>
                        <negate>false</negate>
                    </filter>
                </dataSource>
                <isAny/>
            </test>
            <onPass>
                <action>include</action>
            </onPass>
            <onFail>
                <action>noAction</action>
            </onFail>
            <layout>
                <x>194</x>
                <y>5</y>
            </layout>
        </rule>
    </query>
</libraryItem>
', 'Patients 30-75 registered last months', 'Patients 30-75 registered last months', false);
